import React from 'react'
import { Spinner } from 'react-bootstrap'

function Loader() {
    return (
        <Spinner
            animation="border"
            role="status"
            variant="light"
            style={{
                height: '100px',
                width: '100px',
                margin: 'auto',
                display: 'block'
            }}
            >
        </Spinner>
    )
}

export default Loader
